                        background-position: center;
                        background-attachment: fixed;
                        background-size: cover;
                        color: #fff;
                        text-align:center;
                        padding-top: 250px;
                        padding-bottom: 200px;
                    }
                    .left_side p{
                        padding:0px 20px;
                    }
                   .right_side{
                       padding-top: 200px;
                   } 
                   .right_side h1{
                       text-align: center;
                       font-size: 50px;
                       color:#000;
                       text-transform: uppercase;
                   }
                   .right_side h2{
                    text-align: center;
                    font-size: 30px;
                    color:#000;
                    text-transform: capitalize;
                }
                
                
                `}
            </style>
            
        </div>
    )
}
export default TwoSides
